fn main() -> Result<(), Whatever> { let runtime = VerilatorRuntime::new( "build2".into(), &["src/main.sv".as_ref()], &[], [], VerilatorRuntimeOptions::default(), )?; let mut main = runtime.create_dyn_model( "main", "src/main.sv", &[ ("medium_input", 31, 0, PortDirection::Input), ("medium_output", 31, 0, PortDirection::Output), ], VerilatedModelConfig::default(), )?; main.pin("medium_input", u32::MAX).whatever_context("pin")?; println!("{}", main.read("medium_output").whatever_context("read")?); assert_eq!( main.read("medium_output").whatever_context("read")?, 0u32.into() ); main.eval(); println!("{}", main.read("medium_output").whatever_context("read")?); assert_eq!( main.read("medium_output").whatever_context("read")?, u32::MAX.into() ); Ok(())
} caution Using #[snafu::report] on the function gives error messages that are actually useful, but sometimes breaks LSP services like code completion. I recommend to only apply it to your test functions when you actually encounter an error. We can cargo test as usual to test. If you're using git, remember to add build2/ to your .gitignore. Make sure you pass in the correct filename to create_dyn_model. You only need to pass in a correct subset of the ports. You can use create_dyn_model again with different ports. Of course, if you use the same ports, the model will just be loaded from the cache. You need to bring the AsDynamicVerilatedModel trait into scope to use any methods on a dynamic model.

