use snafu::Whatever;
use marlin::{ verilator::{VerilatorRuntime, VerilatorRuntimeOptions}, verilog::prelude::*,
}; #[verilog::dpi]
pub extern "C" fn three(out: &mut u32) { *out = 3;
} #[verilog(src = "src/dpi.sv", name = "main")]
struct Main; //#[snafu::report]
fn main() -> Result<(), Whatever> { let runtime = VerilatorRuntime::new( "artifacts".into(), &["src/dpi.sv".as_ref()], &[], [three], VerilatorRuntimeOptions::default(), )?; let mut main = runtime.create_model_simple::<Main>()?; main.eval(); assert_eq!(main.out, 3); Ok(())
} caution Using #[snafu::report] on the function gives error messages that are actually useful, but sometimes breaks LSP services like code completion. I recommend to only apply it to your test functions when you actually encounter an error. We can cargo test as usual to test. The magic happens here: #[verilog::dpi]
pub extern fn three(out: &mut u32) { *out = 3;
} By applying #[verilog::dpi], we turn our normal Rust function into a DPI one. We need to apply pub and extern (or extern "C") so that Rust exposes the function correctly to C. DPI functions cannot have a return value and only take primitive integers (for input) or mutable references to primitive integers (for output/inout) as arguments. Beside that, there are no restrictions on the content --- write whatever Rust code you want! Then, we told the runtime about this function: let runtime = VerilatorRuntime::new( "artifacts".into(), &["src/dpi.sv".as_ref()], &[],
- [],
+ [three], VerilatorRuntimeOptions::default(), true, )?; See the documentation for the #[verilog::dpi] macro for more details.

