Now that we have the setup out of the way, we can start testing our code from Rust. We'll initialize a Rust project: cargo init --lib In the Cargo.toml generated, we'll want to add some dependencies: cargo add marlin --features verilog
cargo add snafu --dev The only required crate is marlin, but I strongly recommend at this stage of development to use snafu, which will display a human-readable error trace upon Result::Err. caution Please use snafu! ðŸ˜‚ In the lib.rs, we'll create the binding to our Verilog module: // file: src/lib.rs
use marlin::verilog::prelude::*; #[verilog(src = "src/main.sv", name = "main")]
pub struct Main; This tells Marlin that the struct Main should be linked to the main module in our Verilog file. help It's not necessary to even use the lib.rs -- you can put marlin in your [dev-dependencies] section in Cargo.toml and construct the bindings directly in your test files. Finally, we'll want to actually write the code that drives our project in simple_test.rs: mkdir tests
vi tests/simple_test.rs // file: tests/simple_test.rs
use tutorial_project::Main;
use marlin::verilator::{VerilatorRuntime, VerilatorRuntimeOptions};
use snafu::Whatever; #[test]
//#[snafu::report]
fn forwards_u32max_correctly() -> Result<(), Whatever> { let runtime = VerilatorRuntime::new( "build".into(), &["src/main.sv".as_ref()], &[], [], VerilatorRuntimeOptions::default(), true, )?; let mut main = runtime.create_model_simple::<Main>()?; main.medium_input = u32::MAX; println!("{}", main.medium_output); assert_eq!(main.medium_output, 0); main.eval(); println!("{}", main.medium_output); assert_eq!(main.medium_output, u32::MAX); Ok(())
} caution Using #[snafu::report] on the function gives error messages that are actually useful, but sometimes breaks LSP services like code completion. I recommend to only apply it to your test functions when you actually encounter an error. Let's break down the relevant parts of what's going on here. We first setup the Verilator runtime configuration. We'll use a build directory called "build" in the local directory. let runtime = VerilatorRuntime::new( "build".into(), // build directory (relative) &["src/main.sv".as_ref()], // source files &[], // include search paths [], // DPI functions VerilatorRuntimeOptions::default_logging(), // configuration
)?; tip Add this build directory to your .gitignore file if you're using git. You can fill in the source files (2nd argument) by, for example, finding all .v files in a source direcory with std::fs::read_dir. Since we only have one, we've hardcoded it. Then, we instantiate the model: let mut main = runtime.create_model::<Main>()?; I won't comment on the rest; it's just regular Rust --- including the part where we assign to values and call eval() on the model object! (Yes, that is the same as Verilator's evaluation method). Finally, we can simply use cargo test to drive our design!
